import axios from 'axios'
import { useState } from 'react'

function Form() {
    const [image, setImage] = useState('')
    const handleChange = (e) => {
        setImage(e.target.file)

    }

    const handleSubmit = (e) => {
        e.preventDefault()
        const response = axios.post("http://localhost:3200/images", {
            image: image
        })
        console.log(response);
    }
    console.log(image);
    return <form className='form-inner' encType="multipart/form-data">
        <div className='form-inner'>
            <input type="file" name='image' onChange={(e) => handleChange(e)} />
            <button onClick={(e) => handleSubmit(e)}>upload</button>
        </div>

    </form>
}
export default Form
